export const useSelectedUserStore = defineStore('selectedUser', 
() => {
    const inputValue = ref('')  
    
    const showedUsers = computed(() => {
        return userBase.filter((user) => {
            return `${user.title} + ${user.email}`.toUpperCase().includes(inputValue.value.toUpperCase())
        })
    })

    const activeId = ref(-1)

    const setActive = (id) => {
        activeId.value = id
    }

    const selectedUser = computed(() => {
        return userBase.find((user) => {
            return user.id === activeId.value
        })
    })

    return { 
        inputValue,
        showedUsers,
        activeId,
        selectedUser,
        setActive
    }
});
